import React, { useState } from "react";

const Login = () => {
  return (
    <div class="bg-principal-color h-screen flex items-center justify-center">
      <div class="h-80 w-80">
        <img src="https://wallha.com/download/ws/13/fotYTdx4-wallha.com.jpg" alt="" />
      </div>
      <div class="h-80 w-80 bg-white flex items-center justify-center">
        <p class="text-sm">ProVision</p>
        <p class="text-xl">Bienvenido de Nuevo</p>
      </div>

    </div>
  );
};

export default Login;
